// React
import React from 'react';

// Bootstrap
import { 
    Row, 
    Col
} from 'react-bootstrap';

// Import components
import Navigation from './Navigation.js';
import Footer from './Footer.js';

// Images
import crownHeights from './images/crown_heights.jpg';
import bike from './images/bike.jpg';

// Import CSS for the page and content
import './css/Page.css';
import './css/About.css';

// Content for About
function About() {

    // No transition for the navigation on pages
    return (
        <div>
            <Navigation transition={ false }/>

                {/* Content */}
                <div className='container-page'>
                    <div className='container-content'>

                        {/* Summary text */}
                        <Row className='align-items-center mb-4'>
                            <Col md={ 5 } className='text-left'>
                                <h1 className='page-title mb-5'>
                                    About Me
                                </h1>
                                <p>
                                    Hello! 
                                </p>
                            </Col>
                            <Col md={ 7 } className='text-center flex-row'>
                                <img src={ crownHeights } alt="Joe in Winter" className="joe-image" />
                            </Col>
                        </Row>
                    </div>
                </div>

            {/* Close out the page with the footer */}
            <Footer />
        </div>
    );
}

export default About;
